orgName:"Naam organisatie",portalName:"Naam",verifySetting:"Organisatieverificatie",verifyDesc:'Om de items die u hebt gedeeld aan te merken als autoritatief, moet u Esri verzoeken de identiteit van uw organisatie te verifi\u00ebren. Zorg ervoor dat uw organisatie anonieme toegang toestaat (in Instellingen \x3e Beveiliging \x3e Beleid) om dit te kunnen doen en klik vervolgens op de knop Verifi\u00ebren hieronder. Er zal een concept e-mail verschijnen. Stuur deze e-mail naar de klantenservice van Esri. Pas de tekst of de ontvangers van deze e-mail niet aan. Zodra de e-mail is ontvangen, zal de klantenservice op werkdagen binnen 24-48 uur verifi\u00ebren of de naam van uw organisatie overeenkomt met uw klantnaam en zal de verifieerknop worden vervangen door een badge met de tekst "Geverifieerd".\x3cbr\x3e\x3cbr\x3e\x3cstrong\x3eOpmerking:\x3c/strong\x3e Zodra uw organisatie is geverifieerd, kunnen de naam en status van de organisatie niet meer worden gewijzigd en zullen alle autoritatieve items die met iedereen worden gedeeld, worden toegeschreven aan de naam van de organisatie.',
