sharedThemePortalDesc:"Gebruik de gedeelde thema-instellingen om de kleuren van uw portal toe te passen op informatieproducten die zijn gemaakt van configureerbare app-templates, Web AppBuilder en uw Story Maps. Definieer het gedeelde thema van uw portal met behulp van de onderstaande kleurkiezers en logo-opties.",usageTrackingSetting:"Esri User Experience Improvement Programma",usageTrackingDesc:"ArcGIS Online werkt permanent aan de verbetering van onze producten en een van de beste manier om te ontdekken wat er moet verbeterd worden, is feedback van klanten. Het Esri User Experience Improvement programma (EUEI) stelt uw organisatie in staat om bij te dragen tot het design en de ontwikkeling van ArcGIS Online. Het programma verzamelt informatie over het gebruik van ArcGIS Online, zoals hardware- en browserkenmerken, zonder werkonderbrekingen. Het programma is geheel vrijwillig en anoniem; de verzamelde informatie wordt geenszins gebruikt om leden van uw organisatie te identificeren of om er contact mee op te nemen.",
